import React from 'react';
import './Accordion.css';

const Accordion = ({ onStart, onEdit, onDelete, isOpen, teplate }) => {
  return (
    <div className={`accordion-content ${isOpen ? 'open' : ''}`}>
      <button className='accordion-button' onClick={onStart}>
        Start Workout
      </button>
      <button className='accordion-button' onClick={onEdit}>
        Edit Workout
      </button>
      <button className='accordion-button' onClick={() => onDelete(template)}>
        Delete Workout
      </button>
    </div>
  );
};

export default Accordion;
